import React, { Suspense } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { Loader2 } from 'lucide-react';

// Lazy load components for better performance
const Homepage = React.lazy(() => import('./components/Homepage'));
const UserLayout = React.lazy(() => import('./components/User/UserLayout'));
const AdminLayout = React.lazy(() => import('./components/Admin/AdminLayout'));
const ReportLayout = React.lazy(() => import('./components/Reporting/ReportLayout'));
const Dashboard = React.lazy(() => import('./components/User/Dashboard'));
const Calendar = React.lazy(() => import('./components/User/Calendar'));
const Notifications = React.lazy(() => import('./components/User/Notifications'));
const LogCommunication = React.lazy(() => import('./components/User/LogCommunication'));
const FrequencyReport = React.lazy(() => import('./components/Reporting/FrequencyReport'));
const OverdueTrends = React.lazy(() => import('./components/Reporting/OverdueTrends'));
const EngagementEffectiveness = React.lazy(() => import('./components/Reporting/EngagementEffectiveness'));
const ActivityLog = React.lazy(() => import('./components/Reporting/ActivityLog'));
const CompanyList = React.lazy(() => import('./components/Admin/CompanyList'));
const CommunicationMethod = React.lazy(() => import('./components/Admin/CommunicationMethod'));

// Loading component with spinner
const LoadingSpinner = () => (
  <div className="min-h-screen flex items-center justify-center bg-gray-50">
    <div className="text-center">
      <Loader2 className="h-8 w-8 animate-spin text-blue-600 mx-auto" />
      <p className="mt-2 text-sm text-gray-600">Loading...</p>
    </div>
  </div>
);

const App = () => {
  return (
    <Router>
      <div className="min-h-screen bg-gradient-to-br from-blue-50 to-indigo-50">
        <Suspense fallback={<LoadingSpinner />}>
          <Routes>
            <Route path="/" element={<Homepage />} />
            
            {/* User Routes */}
            <Route path="/user" element={<UserLayout />}>
              <Route index element={<Navigate to="dashboard" replace />} />
              <Route path="dashboard" element={
                <div className="p-6">
                  <Dashboard />
                </div>
              } />
              <Route path="calendar" element={
                <div className="p-6">
                  <Calendar />
                </div>
              } />
              <Route path="notifications" element={
                <div className="p-6">
                  <Notifications />
                </div>
              } />
              <Route path="log-communication" element={
                <div className="p-6">
                  <LogCommunication />
                </div>
              } />
            </Route>

            {/* Admin Routes */}
            <Route path="/admin" element={<AdminLayout />}>
              <Route index element={<Navigate to="company-list" replace />} />
              <Route path="company-list" element={
                <div className="p-6">
                  <CompanyList />
                </div>
              } />
              <Route path="communication-method" element={
                <div className="p-6">
                  <CommunicationMethod />
                </div>
              } />
            </Route>

            {/* Report Routes */}
            <Route path="/reports" element={<ReportLayout />}>
              <Route index element={<Navigate to="frequency" replace />} />
              <Route path="frequency" element={
                <div className="p-6">
                  <FrequencyReport />
                </div>
              } />
              <Route path="overdue-trends" element={
                <div className="p-6">
                  <OverdueTrends />
                </div>
              } />
              <Route path="effectiveness" element={
                <div className="p-6">
                  <EngagementEffectiveness />
                </div>
              } />
              <Route path="activity-log" element={
                <div className="p-6">
                  <ActivityLog />
                </div>
              } />
            </Route>
          </Routes>
        </Suspense>
      </div>
    </Router>
  );
};

export default App;
